package guru.qa.rangiffler.grpc;

import guru.qa.rangiffler.*;
import guru.qa.rangiffler.grpc.config.GrpcTestStubsConfig;
import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.context.annotation.Import;
import org.springframework.test.annotation.DirtiesContext;
import org.springframework.test.context.ActiveProfiles;
import org.springframework.test.context.jdbc.Sql;

import static org.assertj.core.api.Assertions.assertThat;

@SpringBootTest
@ActiveProfiles("test")
@Import(GrpcTestStubsConfig.class)
@DirtiesContext(classMode = DirtiesContext.ClassMode.AFTER_EACH_TEST_METHOD)
class UserDataGrpcIT {

  @Autowired
  private UserDataServiceGrpc.UserDataServiceBlockingStub userDataStub;

  private final String dbUserId = "1315ef2c-9659-4b93-84a2-a1a431b0aae8";
  private final String dbAvatar = "data:image/png;base64,";
  private final String dbUserName = "anna";
  private final String dbFirstName = "Anna";
  private final String dbSurname = "Smith";
  private final String dbCountryCode = "by";

  @Sql(scripts = "/userShouldBeUpdated.sql")
  @Test
  void userDataShouldBeUpdated() {
    String newAvatar = "data:image/png;base64,";

    UpdateUserRequest request = UpdateUserRequest.newBuilder()
        .setId(dbUserId)
        .setFirstname("John")
        .setSurname("Doe")
        .setCountryCode("it")
        .setAvatar(newAvatar)
        .build();

    UserResponse response = userDataStub.updateUser(request);

    assertThat(response.getId()).isEqualTo(dbUserId);
    assertThat(response.getUsername()).isEqualTo(dbUserName);
    assertThat(response.getFirstname()).isEqualTo("John");
    assertThat(response.getSurname()).isEqualTo("Doe");
    assertThat(response.getCountryCode()).isEqualTo("it");
    assertThat(response.getAvatar()).isEqualTo(newAvatar);
  }

  @Sql(scripts = "/userShouldBeUpdated.sql")
  @Test
  void shouldReturnUserByUsername() {
    var response = userDataStub.getUserByUsername(
        UsernameRequest.newBuilder().setUsername(dbUserName).build()
    );

    assertThat(response.getUsername()).isEqualTo(dbUserName);
    assertThat(response.getFirstname()).isEqualTo(dbFirstName);
    assertThat(response.getSurname()).isEqualTo(dbSurname);
    assertThat(response.getCountryCode()).isEqualTo(dbCountryCode);
    assertThat(response.getAvatar()).isEqualTo(dbAvatar);
  }

  @Sql(scripts = "/userShouldBeUpdated.sql")
  @Test
  void shouldReturnUserById() {
    var response = userDataStub.getUserById(
        UserIdRequest.newBuilder().setUserId(dbUserId).build()
    );

    assertThat(response.getId()).isEqualTo(dbUserId);
    assertThat(response.getUsername()).isEqualTo(dbUserName);
    assertThat(response.getFirstname()).isEqualTo(dbFirstName);
    assertThat(response.getSurname()).isEqualTo(dbSurname);
    assertThat(response.getCountryCode()).isEqualTo(dbCountryCode);
    assertThat(response.getAvatar()).isEqualTo(dbAvatar);
  }

  @Sql(scripts = "/userShouldBeUpdated.sql")
  @Test
  void shouldPartiallyUpdateUser() {
    String newName = "NewName";

    var request = UpdateUserRequest.newBuilder()
        .setId(dbUserId)
        .setFirstname(newName)
        .build();

    var response = userDataStub.updateUser(request);

    assertThat(response.getId()).isEqualTo(dbUserId);
    assertThat(response.getUsername()).isEqualTo(dbUserName);
    assertThat(response.getFirstname()).isEqualTo(newName);
    assertThat(response.getSurname()).isEqualTo(dbSurname);
    assertThat(response.getCountryCode()).isEqualTo(dbCountryCode);
    assertThat(response.getAvatar()).isEqualTo(dbAvatar);
  }
}